import React from "react";
import logo from "./logo.svg";
import "./App.css";
const styles = {
  text: {
    textAlign: "center",
  },

  shopimage: {
    display: "block",
    marginLeft: "auto",
    marginRight: "auto",
    width: "50%",
  },

  prodimag: {
    width: "300px",
    height: "300px",
  },

  list: {
    alignitems: "center",
    justifyContent: "center",
    display: "flex",
  },

  photmar: {
    margin: "20px",
  },
};
function App() {
  return (
    <div>
      <div>
        <img
          src="https://images.squarespace-cdn.com/content/v1/569ede52b20943c52005dd02/1473886777959-747QI1IHVYIL59RC8072/ke17ZwdGBToddI8pDm48kLxnK526YWAH1qleWz-y7AFZw-zPPgdn4jUwVcJE1ZvWEtT5uBSRWt4vQZAgTJucoTqqXjS3CfNDSuuf31e0tVH33scGBZjC30S7EYewNF5iKKwhonf2ThqWWOBkLKnojuqYeU1KwPvsAK7Tx5ND4WE/image-asset.jpeg"
          alt="logo"
          style={styles.shopimage}
        />
        <h1 style={styles.text}>Welone to our Shop</h1>
      </div>
      <div style={styles.list}>
        <div>
          <img
            src="https://cdn4.vectorstock.com/i/1000x1000/35/68/tool-box-with-toolkit-set-vector-7283568.jpg"
            alt="tools"
            style={styles.prodimag}
          />
          <p style={styles.text}>Tools Box</p>
          <p style={styles.text}> PRICE 30 KD</p>
        </div>
        <div>
          <img
            src="https://cdn.vox-cdn.com/thumbor/E8c5U6A_RrsyiwRANmcCLNE2dzc=/0x0:2040x1360/1400x933/filters:focal(860x560:1186x886):no_upscale()/cdn.vox-cdn.com/uploads/chorus_image/image/55855309/akrales_190913_3628_0277.19.jpg"
            alt="Phone"
            style={styles.prodimag}
          />
          <p style={styles.text}>Tools Box</p>
          <p style={styles.text}> PRICE 20 KD</p>
        </div>
      </div>
    </div>
  );
}

export default App;
